(16662, '2179774F-951B-4B00-AF8C-928B39B34DB6', 'Love, I‚Äôm sorry that my actions have eroded your trust and have felt hurtful. I know I have work to do....both on my own and together with you. This stuff is really hard and uncovers uncomfortable truths about myself.  I feel my defenses rise and I feel hurt when you replay how the way I‚Äôve acted and spoken/not spoken has hurt you.  But you have never shied away from being fully accountable,  and taking hard feedback and working with it. It has always been one of your qualities that I have admired and loved about you. It helps give me the courage to reciprocate...or at least try to emulate...and to do my own work so I can show up to you as a man with integrity. I‚Äôm committed to doing this work....for myself and for you and for us. This all feels like uncharted territory....which is uncomfortable. I‚Äôm beginning to fully appreciate how many layers are at play here....and how many opportunities there are to go sideways. And when it does, I‚Äôm sorry. It feels terrible. Please know how much I treasure and adore you...and that I will not only say these words, but will pour my heart and energy into being and acting better. I love you.', '627936960145999872', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', 'David', '2020-11-24T10:56:00.146000'),
