(16669, '09E2DF3B-DAA1-4D24-8C46-35AE3C8EFA74', 'IÔ∏è keep thinking in my head ‚Äúoh so if IÔ∏è had asked ‚Äúdid you have a naked hot tub party instead of did you kiss her‚Äù would IÔ∏è have gotten a more honest answer. And of course, it never would have dawned on me to ask that specific kind of question in the first place. So there in lies the problem. We can define all the scenarios and it‚Äôs easy to justify why it‚Äôs ok not to say the truth. And it‚Äôs also easy to make it seem like our actions, as innocuous as they are, may have deeper meaning for others. Or they may have deeper meaning for ourselves than we are willing to acknowledge. Acknowledgement is the first step. So IÔ∏è really do appreciate this note, deeply. And IÔ∏è am eager to get this stage behind us. ', '627938762418978432', '627938860045902976', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', '+19172390518', '2020-11-24T11:26:02.418978'),
