(16947, 'BE051AB6-478D-4C57-9A61-A2EE53653D6E', 'Hi love, was 1/2 listening to a book on tantra this morning while not sleeping and heard that a meaning in Sanskrit roughly translates to ‚Äúto weave.‚Äù  And I was thinking about last night dinner and your inspiration to become ‚Äúa weaver‚Äù of community...which is what you have done. You had an intention and a vision and....it is coming to pass. I couldn‚Äôt be prouder of you and I share in your joy as you take in how you have sparked something that is transformational. And, how awesome that it is becoming self-sustaining as each Climber feels invested in helping others. This is by design...a design with principles that are a culmination  of 20 years of your career, and...of your own self-development. It is why climb hire will be resilient .... just like you, and us.  I am going to share this song for you to listen to on your own. It asks the question, ‚Äúwill we make it to the other side?‚Äù  When I wrote this, this was an open question. I didn‚Äôt know if I could get past what had happened. I didn‚Äôt know if the Metaphorical bonfire would simply consume us....or could we find new air, a new life giving breath to make a new fire. And now, this is not a question in my mind. I know there is new fire, and I can feel as we peel away new layers and discover more about ourselves and how we interact, the birth of 2.0. This was not a given...and I keep Being surprised as we face new challenges...but what makes it work is that each of us is committed to and hunger for insights about ourselves, and are not afraid to push into the uncomfortable truths of our own flaws. And...then we use this as fuel for one another. I saw Tzvika today and couldn‚Äôt help feel sad for him. I want to do this work with you, next to you. I have never felt more committed or clear. As I say in the song ‚ÄúI‚Äôll love you ‚Äòtil my heart stops.‚Äù Let‚Äôs hope for both of us...that won‚Äôt be too soon. We have much exploring to do with one another.  I love you, my beautiful weaver.', '628300055442992896', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', 'David', '2020-11-28T15:47:35.442993'),
